package db.domain;import java.util.Arrays;public class SkillsImpl implements Skills {	@Key	private String uname;	@Key	private int ids;	private int skillId;	private int level;	private int exp;	private int fighterTypeId;	public SkillsImpl() {	}	public SkillsImpl(Skills c) {		this.uname = c.getUname();		this.ids = c.getIds();		this.skillId = c.getSkillId();		this.level = c.getLevel();		this.exp = c.getExp();		this.fighterTypeId = c.getFighterTypeId();	}	@Override	public String tableName() {		return "skills";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setIds(int ids) {		this.ids = ids;	}	public int getIds() {		return this.ids;	}public void addIds(int ids) {		this.ids += ids;}	public void setSkillId(int skillId) {		this.skillId = skillId;	}	public int getSkillId() {		return this.skillId;	}public void addSkillId(int skillId) {		this.skillId += skillId;}	public void setLevel(int level) {		this.level = level;	}	public int getLevel() {		return this.level;	}public void addLevel(int level) {		this.level += level;}	public void setExp(int exp) {		this.exp = exp;	}	public int getExp() {		return this.exp;	}public void addExp(int exp) {		this.exp += exp;}	public void setFighterTypeId(int fighterTypeId) {		this.fighterTypeId = fighterTypeId;	}	public int getFighterTypeId() {		return this.fighterTypeId;	}public void addFighterTypeId(int fighterTypeId) {		this.fighterTypeId += fighterTypeId;}}